import React from "react";

export default function BlueHeader({ title, subtitle }) {
  return (
    <div className="w-full bg-blue-600 py-8 px-6 mb-8 rounded-b-lg shadow-md">
      <h1 className="text-3xl font-bold text-white">{title}</h1>
      {subtitle && <p className="text-white text-lg mt-2">{subtitle}</p>}
    </div>
  );
}
